import React from 'react';
import './App.css';

function Subject(){
  return (
    <header>
      <h1>WEB</h1>
      world wide web!!
    </header>
  );
}

function TOC(){
  return (
    <nav>
      <ul>
        <li><a href="1.html">HTML</a></li>
        <li><a href="2.html">CSS</a></li>
        <li><a href="3.html">JavaScript</a></li>
      </ul> 
    </nav>
  );
}

function Content(){
  return (
    <article>
      <h2>HTML</h2>
      HTML is hyperText Markup Language
    </article> 
  );
}


function App() {
  return (
    <div className="App">
      <Subject></Subject>
      <TOC></TOC>
      <Content></Content>
    </div>
  );
}

export default App;
